/**
 * constants.js
 * -----------------------------
 * Centralized configuration constants for the frontend application.
 *
 * - Fonts (encoded as base64)
 * - API base URL (switches between environments)
 * - API endpoint paths
 */

/* ======================
   Fonts
   ====================== */
/**
 * Base64-encoded fonts: Assistant-Regular, Assistant-Bold
 * Used for embedding the font directly if needed.
 */
export const ASSISTANT_FONT_BASE64 = "";
export const ASSISTANT_BOLD_FONT_BASE64 = "";

/* ======================
   API Base URL
   ====================== */
/**
 * API base URL:
 * - Loaded from environment variable `VITE_APP_API_URL ` (see frontend/.env)
 * - Falls back to `http://localhost:3000` in development
 */
export const API_BASE = import.meta.env.VITE_APP_API_URL  || "http://localhost:3000";

/* ======================
   API Endpoints
   ====================== */
/**
 * Standardized API endpoints for accessing backend routes.
 * 
 * These should match the Express routes defined in server.js:
 * - /api/lists
 * - /api/items
 * - /api/categories
 * - /api/units
 * - /api/statistics
 */
export const API_LISTS = `${API_BASE}/api/lists`;
export const API_ITEMS = `${API_BASE}/api/items`;
export const API_CATEGORIES = `${API_BASE}/api/categories`;
export const API_UNITS = `${API_BASE}/api/units`;
export const API_STATISTICS = `${API_BASE}/api/statistics`;